I recently visited Abu Sandeep’s store at Dhan Mill and it was an absolute treat! 

The store houses womenswear and menswear by Abu Sandeep alongside their pret label, Gulabo. It has the most stunning and versatile options for all occasions. Whether you like it subtle or bold, the labels offer unique designs that will make fabulous additions to your wardrobe.

